mutation CreateCompany($name: String!) {
  createCompany(name: $name) {
    __typename
    id
    name
  }
}

da0090621f4a8f0762a525c684880660eac46d54.source:
query ArtistDetails($id: ID!) {
  artist(id: $id) {
    __typename
    ...ArtistInfo
    groups {
      __typename
      id
      displayName
      secondaryDisplayName
      images {
        __typename
        cardFlat
      }
    }
    members {
      __typename
      id
      displayName
      images {
        __typename
        icon
      }
    }
  }
}
